import ProductItem from "./ProductItem";
import classes from "./Products.module.css";

const DUMMY_ITEMS = [
  { id: 1, name: "Book", price: 5, desc: "abc" },
  { id: 2, name: "Table", price: 15, desc: "def" },
  { id: 3, name: "Chair", price: 7, desc: "ghi" },
  { id: 4, name: "Bike", price: 599, desc: "jkl" },
  { id: 5, name: "Truck", price: 899, desc: "mno" },
];

const Products = (props) => {
  return (
    <section className={classes.products}>
      <h2>Buy your favorite products</h2>
      <ul>
        {DUMMY_ITEMS.map((item) => (
          <ProductItem
            key={item.id}
            name={item.name}
            price={item.price}
            desc={item.desc}
          />
        ))}
      </ul>
    </section>
  );
};

export default Products;
